import React from 'react';
import './Testimonials.css';

function Testimonials() {
  return (
    <section className="testimonials">
      <div className="container">
        <h2>Testimonials</h2>
        <blockquote>“This should be built into every chat app.” – Relationship Therapist (Beta Tester)</blockquote>
        <blockquote>“We fought less in one week using Communicat than we have in months.” – Early User (Private Test Group)</blockquote>
      </div>
    </section>
  );
}

export default Testimonials;
